import React from 'react';
import {connect} from 'react-redux';
import {Link} from 'react-router-dom';


const ScopeList = () => {
    return (
    <div className="ui container">
        <Router history = {history}>
            <div>
            <Route>
                <Route path="/" exact component={ScopeList} />
                </Route>
            </div>
        </Router>
    </div>
)}

export default ScopeList;
